  false,\n\t\"url\": null,\n\t\"notes\": \"Surveys of the bathymetry and backscatter
  intensity of the sea floor south of Long Island, New York, were carried out in November
  1998 using a Simrad EM1000 multibeam echosounder mounted on the Canadian Coast Guard
  ship Frederick G. Creed. The purpose of the multibeam echosounder surveys was to
  explore the bathymetry and backscatter intensity of the sea floor in several areas
  off the southern coast of Long Island along the 20-meter isobath. Survey areas offshore
  of Fire Island Inlet, Moriches Inlet, Shinnecock Inlet, and southwest of Montauk
  Point were about 1 kilometer (km) wide and 10 km long. The area was mapped by the
  U.S. Geological Survey with support from the Canadian Hydrographic Service and the
  University of New Brunswick.\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
